INSERT INTO `blog` (`id`, `posted_at`, `title`, `content`, `position`, `link`, `position_image`, `image`) VALUES
(2, '2014-05-05 00:00:00', 'La plongée du dimanche matin', '<p>Presque tous les dimanches, pour ceux qui le souhaitent, une plongée s&#39;organise dans les lacs autour de Grenoble (Lac de Laffrey, Lac du Bourget). \r\n\r\n<p>L&#39;été et l&#39;automne sont les meilleures périodes pour tester les plongées en lac. Proche de la surface la température de l&#39;eau est très agréable.\r\n<p>N&#39;oubliez pas de vous inscrire !!! Les informations se trouvent dans la rubrique Sorties Explo : <a href=\"index_exploration.php\">Les plongées du dimanche matin</a> :-).', 13, '', 'dessous', '20140605-130645-dimanchematin.jpg'),
(3, '2014-05-05 00:00:00', 'Le Magazine du GUC Plongée', '<p>Génial, un nouveau GUC Plongée Magazine !!! Avec le bilan de l\'année 2013/2014 et plein plein d\'article.</p>\r\n<p>Merci à Nicoleta et aux nombreux rédacteurs.</p>\r\n<p>Cliquez <a href=\"docs/GucMag-sept2014.pdf\" target=\"_blank\">ICI</a> pour télécharger le magazine.</p>', 1, 'http://guc-plongee.net/docs/GucMag-sept2014.pdf', 'droite', '20140605-130602-GucMag.jpg'),
(10, '2014-05-25 00:00:00', 'Validation des N1 saison 2014', '<p>Lors du week-end des 24 et 25 mai le GUC Plongée a pu valider 27 niveaux N1 !!!\r\n<p>Un grand merci à Joe (nouveau N1) pour cette <a href=\"https://www.youtube.com/watch?v=TboF4saM8Og\" target=\"_blank\">superbe vidéo souvenir session N1 2014</a> retraçant ce week-end avec une plongée sur le Chaouen sur l&#39;île du Planier, la remise des diplômes et quelques souvenirs des séances d&#39;entrainements à la piscine.', 2, '', 'dessous', '20160306-170339-tmpfile.jpg'),
(21, '2014-10-10 00:00:00', 'LES 50 ANS DU GUC PLONGEE A NIOLON LES 1er et 2 NOVEMBRE 2014', '<p>Voilà, cet évènement est maintenant derrière nous, laissant à la plupart le souvenir d’un week-end très sympa qui a rempli ses promesses avec ses 147 participants dont 90 plongeurs.<br>\r\n\r\nRemerciement à :<br>\r\n- le bon Dieu de nous avoir réservé le morceau de beau temps qui nous a un peu manqué cet été.<br>\r\n- Neptune pour la douceur, le calme et la clarté de  son eau. Les tropiques à Niolon en Novembre. Qui l’eut cru ?<br>\r\n- l’équipe de l’UCPA qui a vraiment assuré de bout en bout : les pilotes et moniteurs de plongée, via corda et Kayak, les BAFAs, les cuisiniers, le staff<br>\r\n- Francis LeGuen pour la qualité de son intervention<br>\r\n- Les moniteurs qui ont encadré les N1 : Maude, Thierry, Bruno, JF, Flo, Daniel, Didier, Xavier, Serge, Guy, Fred, Remy, Philippe<br>\r\n- Les organisateurs : Thomas qui a probablement amélioré sa péda organisationnelle, Guitoune, Maude, Sylvie, Thierry<br>\r\n- Pierre pour la création ET la fabrication des gobelets 50 ans. A laisser dans le sac de plongée …<br>\r\n- Sandrine pour le design de la collection GUC 2014 « spécial 50 ans ».<br>\r\n- tous les autres travailleurs de l’ombre qui ont apporté leur aide à leur manière et ceux que j’ai oubliés, comme d’hab. Qu’ils me pardonnent.<br>\r\n- vous tous pour votre présence et votre bonne humeur<br>\r\n<br>\r\nEt puis …<br>\r\n\r\nFée Clochette sans qui ce week-end aurait été si différent<br>\r\n\r\nMerci à tous d’envoyer vos photos a Nicoleta, qui se fera un plaisir de nous concocter un GUC Plongée magasine (le Bulle quoi) spécial 50 ans<br>\r\nEt puis merci à Serge pour cette vidéo souvenir de la plongée sur le <a href=\"https://www.youtube.com/watch?v=eMwq_s0_WkU\" target=\"_blank\">Miquelon</a>. <br>', 3, '', 'dessous', '20141110-191101-tmpfile.jpg'),
(23, '2014-11-20 00:00:00', 'Inscriptions Saison 2014-2015', 'Les inscriptions pour la saison 2014-2015 sont maintenant terminées, sauf licences passagers, maintien et cas particuliers.<br>\r\nA partir du 20 décembre, pour toute nouvelle demande d\'inscription en formation, veuillez d\'abord nous contacter via la rubrique Contact.', 4, '', 'droite', NULL),
(24, '2015-01-01 00:00:00', 'BONNES ANNEE 2015 AVEC PLEIN DE PETITES BULLES', 'Cette année 2015 commence bien avec un article sur le week-end des 50 ANS à Niolon dans le SUBAQUA n°258 de janvier et février (page 98).<br>\r\n<br>\r\nPour fêter ce début d\'année, soirée Galette des Rois mardi 20 janvier à laMaison du GUC !!!<br>\r\nEt puis en forme de voeux pour 2015, encore une superbe vidéo de Serge pour les <a href=\"https://www.youtube.com/watch?v=df68dL3UBJY&feature=youtu.be\" target=\"_blank\">50 ANS du GUC PLONGEE</a>. <br>', 6, '', 'gauche', '20150115-090144-tmpfile.jpg'),
(31, '2015-02-18 00:00:00', 'Saison 2015 - Vive la reprise des WE techniques NIOLON !!!', 'Le quatrième Week-end technique de formation aura lieu les 9 et 10 mai au centre de plongée UCPA de Niolon.\r\n\r\nLors du dernier week-end des 25 et 26 avril, 6 plongeurs ont pu valider leurs niveaux !!! Le club compte donc 4 N2 et 2 Pe40 de plus. Cela animera certainement les discussions des prochains mardi.', 7, '', 'droite', '20150318-000319-tmpfile.jpg'),
(32, '2015-04-13 00:00:00', 'Surperbe Week-End au Levant les 1er, 2 et 3 mai 2015', 'Ce week-end de 3 jours sur l’île du Levant était organisé de longue date  !!! En effet il n\'est pas facile de pouvoir bloquer toutes les places du centre UCPA de cette magnifique et calme île du Levant. Et c\'est un base très pratique pour aller explorer les fonds marins de la Gabinière et de Port Cros. \r\nSi le vent était présent, la météo a été clémente et nous avons pu user de la grande terrasse du centre, mais aussi passer de belles soirées animées. Et la faune sous-marine était bien sûr présente avec ses bancs de barracuda, les innombrables mérous, dentis, sars et dorades, mais aussi les congres, murènes, corbs, araignées de mer, langoustes, homards, doris... Certains se sont même fait friser les moustaches par un thon !!!\r\nMerci aux organisateurs : Aurélie et Olivier.', 8, '', 'gauche', '20150513-230533-tmpfile.jpg'),
(34, '2015-04-28 00:00:00', 'Week-End de Validation N1 en mer les 30 et 31 mai 2015 à Niolon', 'Ce week-end a été ensoleillé et la mer calme. Et ce sont 13 N1 qui ont été délivrés !!! Mais aussi 3 nouveaux N2 !!! <br>\r\nMerci à Xavier pour la <a href=\"https://www.youtube.com/watch?v=uAIQv9NGTxU\" target=\"_blank\">vidéo souvenir session N1 2015</a><br>\r\nAprès une saison de préparation en piscine, ce fut enfin la récompense et la validation en mer de ce premier niveau qui va ouvrir la voie à de très nombreuses plongées dans des mers chaudes, moins chaudes, voire en lac.<br>\r\nBravo à tous !!!!', 9, '', 'dessous', '20150531-230533-tmpfile.jpg'),
(36, '2015-06-13 00:00:00', 'Baptêmes de plongée à Decathlon', 'Le 4 juillet 2015, le GUC PLONGEE a organisé des baptêmes de plongées en partenariat avec la magasin DECATHLON de La Tronche.\r\n\r\nC\'est sur le parking du magasin, sous un soleil de plomb, que s\'est déroulée cette journée et de nombreux enfants ont pu découvrir la plongée alors qu\'ils ne s\'y attendaient pas. Tous sont ressortis enchantés !!! Certains ont déjà repris rendez-vous pour essayer de nouveau dans un bassin plus grand.\r\n<br>\r\nMerci à Oriane et DECATHLON La Tronche d\'avoir mis en place cette animation. Nous avons pu aussi signer un accord de partenariat avec le magasin.', 10, '', 'gauche', '20150713-140744-tmpfile.jpg'),
(37, '2015-06-13 00:00:00', 'BBQ et Chasse au trésor à Chamagnieu', 'Ce week-end des 11 & 12 juillet ont eu lieu les traditionnels BBQ et Chasse au trésor sur la base de plongée de Chamagnieu. C\'est un vingtaine de plongeurs qui a pu ainsi s\'amuser à retrouver les 6 balises immergées avec récompenses à la clé pour les plus méritants, et ils ont été nombreux. <br>\r\n\r\nPour la première fois, une partie des participants a aussi pu commencer cette sortie dès le samedi après-midi avec une nuit dans les chalets du centre avec apéro, BBQ et repas à la belle étoile, et elles étaient magnifiques ces étoiles avec le ciel dégagé de Chamagnieu.<br><br>\r\n\r\nEt qu\'on se le dise, à l\'issue de ce week-end, tous n\'ont pas fait que la chasse au trésor, et nous comptons donc 2 nouveaux N2 : Florence et Fabrice.', 11, '', 'droite', '20150713-160729-tmpfile.jpg'),
(38, '2015-07-21 00:00:00', 'Forum des Sports de Grenoble le samedi 5 septembre 2015', 'Comme chaque année depuis maintenant 5 ans, notre club était présent au Forum des Sports organisé par l\'OMS de Grenoble à Grand\'Place de 9h30 à 18h.<br><br>\r\nNous avons pu vous renseigner de vive voix sur toutes nos activités et répondre à toutes vos questions...sur la plongée ;-)\r\n<br><br>\r\nRendez-vous l\'année prochaine.', 12, '', 'droite', '20150821-150850-tmpfile.jpg'),
(41, '2015-12-07 00:00:00', 'Exceptionnel : Soirée Grands Requins Blancs le lundi 7 décembre 2015', 'Le 7 décembre, le GUC Plongée a invité le Dr. Alessandro Maddalena, un spécialiste des requins, pour animer une conférence sur les grands requins blancs. \r\n<br><br>\r\n130 personnes, pour moitié extérieures au club, ont pu assister à cet événement et apprécier les qualités de conférencier d\'Alessendro, avec un joli accent italien et un humour certain, et découvrir les techniques prédatoires des requins blancs de Seal Island à False Bay en Afrique du Sud.   \r\n<br><br>\r\nMerci à Alessandro d\'avoir pu nous faire profiter de son expérience et de ses recherches qu\'il conduit dans le respect de la vie de ces formidables animaux.\r\n<br>', 15, '', 'dessous', '20151217-001232-tmpfile.jpg'),
(42, '2015-11-17 00:00:00', 'Noel 2015', 'Le 15 décembre, le GUC Plongée a fêté Noel avec un père et une mère Noel !!!\r\n<br><br>\r\nVoici une petite carte souvenir.\r\n<br><br>\r\nEt tout le monde est reparti avec son petit cadeau !!!\r\n<br>', 16, '', 'gauche', '20151217-221252-tmpfile.jpg'),
(43, '2016-01-20 00:00:00', 'Soirée Couscous le 3 février 2016', 'Le mercredi 3 février 2016, le GUC Plongée a organisé une soirée COUSCOUS au restaurant \'La belle étoile\' à Grenoble.\r\n<br><br>\r\n43 adhérents ont répondu à cette invitation et nous avons passé une très agréable soirée en dehors du bassin habituel.\r\n<br><br>\r\nCela a permis aux adhérents des différents sections de se retrouver et de pouvoir échanger sur les plongées passées et futures.\r\n<br><br>\r\nDe l\'avis de tous : A refaire !!!', 17, '', 'droite', '20160220-170229-tmpfile.jpg'),
(44, '2016-01-20 00:00:00', 'Formation à la fosse de plongée de Meyzieu', 'Durant cette période hivernale, les formations en piscine le mardi soir continuent bien sûr !!! Mais à celles-ci viennent s\'ajouter les formations à la fosse de plongée de Meyzieu dans une eau limpide à 29° !!!\r\n<br><br>\r\nDepuis le dimanche 10 janvier, environ tous les 15 jours, ce sont entre 15 et 18 plongeurs qui se retrouvent à l\'espace aquatique les Vagues, à Meyzieu, pour effectuer 2 plongées d\'une heure et pouvoir se perfectionner. Ces formations sont ouvertes en priorité aux plongeurs préparant le Niveau 2 mais aussi à ceux préparant les Niveaux 3 et 4.\r\n<br><br>\r\nLa dernière séance a eu lieu le 28 février. Rendez-vous donc prochainement à Niolon pour la première sortie technique en mer.\r\n<br>', 18, '', 'gauche', NULL),
(45, '2016-02-06 00:00:00', 'Saison 2016 - Les WE techniques NIOLON !!!', 'Tous WE techniques mer ont eu lieu au centre de plongée UCPA de Niolon.\r\n<br><br>\r\nDès les 19 et 20 mars, 33 plongeurs étaient présents et ont pu goûter à une eau assez fraîche...mais dans la bonne humeur.<br>\r\n<br>\r\nLe WE des 9 et 10 avril 30 plongeurs étaient présents et nous avons pu diplômer 2 nouveaux N2 !<br>\r\n<br>\r\nLors du WE des 23 et 24 avril, le soleil était bien présent mais la mer était un peu agitée le samedi et un vent glacial a figé la calanque dimanche. Mais cela ne nous a pas empêché de plonger et de continuer les formations, avec de nombreux succès: 1 N3, 3 N2 et 3 PE40 !!! 30 plongeurs étaient au rendez-vous. <br>\r\n<br>\r\nLors du WE des 21 et 22 mai le soleil fût de nouveau présent et bien chaud et la mer calme ! 23 plongeurs et  plongeuses (voir photo) ont pu profiter de cette météo très clémente. 3 brevets N3 et 1 brevet N2 ont été délivrés.<br>\r\n<br>\r\nLe WE des 28 et 29 mai était un peu particulier puisque c\'était aussi la sortie premières bulles de nos PrépaN1 (voir article correspondant). Et c\'est sous le soleil et avec une mer calme que nous avons aussi pu valider 1 nouveau N3 et 2 nouveaux N2.<br>\r\n<br>Lors du dernier WE technique de l\'année, les 11 et 12 juin, ce sont finalement 1 N1, 1 PE40, 3 N2 et 1 N3 qui ont pu être validés. Mais en plus nous avions un examen N4 et 5 candidats ont réussi cet examen qui leur ouvre les portes de l\'encadrement.<br>\r\n<br>Place maintenant aux WE de plongées d\'exploration pendant lesquels tous nos nouveaux certifiés pourront utiliser leur nouvelles compétences.', 21, '', 'dessous', '20160603-090609-tmpfile.jpg'),
(46, '2016-03-24 00:00:00', 'Mars 2016 - Sortie tropicale au Soudan', 'Onze GUCistes reviennent d’une semaine de plongée au Soudan. Au programme, la mythique épave de l’Umbria, un imposant cargo de 150m très bien conservé et plein de matériel, les vestiges de Précontinent 2 de Jacques Yves Cousteau, le poissonneux récif de Shab Rumi, le tout sur fond de requins marteau et gris à chaque plongée. \r\n<br><br>\r\nSi on vous dit tout ça, c’est non seulement pour vanter les paysages tropicaux du Soudan, mais aussi pour restaurer un peu la très mauvaise réputation du Soudan largement ternie par les évènements du Darfour. Le Soudan du Sud et le Darfour, c’est un autre pays, situé a plus de 2000Km du Soudan du Nord. Certes, le Soudan n’est pas une démocratie, mais ce n’est pas non plus un pays de terroristes. Nous nous sommes baladés dans port Soudan pour visiter un église catholique, le souk, le marché aux poissons (le Rungis du coin) avant de faire une pause dans une cafétéria. Les Soudanais sont aimables, souriants, et les vendeurs moins collants que dans certains pays que vous connaissez bien.  \r\n<br><br>\r\nAllez-y sans appréhension particulière, mais une recommandation : le voyage est long, alors autant rester deux semaines sans retour au port. Merci à Jérôme pour l’excellence de l’organisation.', 19, '', 'droite', '20160330-220351-tmpfile.jpg'),
(48, '2016-08-02 00:00:00', 'Forum des Sports de Grenoble le 3 Septembre 2016', 'Comme chaque année, le GUC PLONGEE était présent au Forum des Sports organisé par l\'OMS de Grenoble le <br>\r\n<br>\r\nSAMEDI 3 SEPTEMBRE de 9h30 à 18h à Grand\'Place<br>\r\n<br>\r\nNous avons rencontré de nombreuses personnes et répondu à leurs questions au sujet de la plongée et de notre club.\r\n<br><br>', 22, '', 'gauche', '20160902-090937-tmpfile.jpg'),
(51, '2016-08-10 00:00:00', 'Sortie club Estartit et autres', 'En direct de l\'Estartit, où un petit groupe de gucistes passe du bon temps, accompagnés de conditions météo exceptionelles.\r\n<br><br>\r\nMais ce n\'est pas la seule sortie de cet automne 2016, puisque 6 sorties ont été organisées :\r\n<ul>\r\n<li>Sortie Explo à Estartit les 10 et 11 septembre,</li>\r\n<li>Sortie Bénévoles à la Seyne/Mer les 10 et 11 septembre aussi,</li>\r\n<li>Sortie Explo à Golfe-Juan les 24 et 25 septembre,</li>\r\n<li>Sortie Explo à Sanary les 1er et 2 octobre,</li>\r\n<li>Sortie Tombants de Marseille les 15 et 16 octobre,</li>\r\n<li>Sortie Explo de rentrée à Niolon les 29 et 30 octobre.</li>\r\n</ul></p>', 23, '', 'dessous', '20160910-230952-tmpfile.jpg'),
(52, '2016-11-25 00:00:00', 'Bonnes Fêtes de Noel et Bonne Année 2017', 'Après de nombreux week-end en septembre, octobre et novembre, l\'année 2016 se termine.<br><br>\r\n\r\nNous nous retrouverons dès le mardi 3 janvier pour la reprise des activités piscines. <br>\r\n\r\nPuis, pour les volontaires, le 14 janvier 2017 pour la plongée de l\'An Neuf organisée par le club La Terrasse Plongée au lac de La Terrasse.<br>\r\n\r\nEt enfin reprise des fosses de plongée pour les prépa N2 à Meyzieu le lendemain, le 15 janvier. <br><br>\r\n\r\nDonc reprise énergique pour 2017.<br>\r\n\r\nBonnes fêtes à tous.', 25, '', 'gauche', '20161225-011224-tmpfile.jpg'),
(53, '2017-01-15 00:00:00', 'Vacances d\'Hiver en Martinique', 'Une trentaine de plongeur du club passent leurs vacances d\'hiver en Martinique , à l\'UCPA de Saint Pierre !!!<br>\r\nAu programme : plongées sur les magnifiques sites tels que l\'épave du Rorema, le rocher de la Perle, amis aussi\r\nde belles randonnées sur le mont Pelé, les innombrables traces a travers les forets primitives, et bien entendu les\r\nincontournables rhumeries a apprécier avec modération.', 26, '', 'dessous', '20170301-220328-tmpfile.jpg'),
(54, '2017-02-13 00:00:00', 'Saison 2017 - WE techniques à NIOLON', 'Comme chaque année nous avons fait l\'ouverture du centre UCPA de Niolon avec le premier WE technique les 18 et 19 mars. Et surprise, c\'est un nouvel espace restauration qui nous a accueilli le samedi matin. SUPERBE ! L\'eau était un peu fraîche mais le soleil bien présent, surtout le dimanche, et c\'est avec un grand plaisir que les 34 plongeurs ont testé la cuvée 2017 de l\'eau de la cote bleue, avec des plongées sur le Moulon, l\'Elvine et Baume rousse.Et déjà 4 qualifications NITROX ont été délivrées.<br>\r\n<br> \r\nLe second week-end technique a eu lieu les 1 et 2 avril ... sous la pluie et avec une température assez fraîche. Mais cela n\'a pas diminué l\'enthousiasme des 36 plongeurs avec des préparations au N2, au N3, au N4 et au MF1 !!! Et même la délivrance du premier N3 de l\'année (Nicolas) !<br>\r\n<br>\r\nMais le troisième week-end des 22 et 23 avril s\'est déroulé sous un grand soleil, avec une mer un peu agitée le samedi, mais redevenue calme le dimanche pour le plus grand plaisir de nombreux plongeurs. Il y a aussi eu la validation de deux nouvelles N2 (Stéphanie et Cécile) et 4 qualifications Nitrox !<br>\r\n<br>\r\nLe week-end des 6, 7 et 8 mai, malgré une météo et une mer assez compliquées, surtout le samedi matin, 7 N2 et 2 N3 ont pu être validés. BRAVO AUX LAUREATS ET A L\'EQUIPE D\'ENCADREMENT.<br> <br>\r\nLe cinquième week-end s\'est déroulé en même temps que les premieres bulles 2017. Ce fut donc un gros week-end avec 51 plongeurs. A l\'issue, 5 N2 et 4 N3 ont pu être validés en plus des 12 N1. BRAVO !!!<br><br>\r\nLe dernier week-end technique de la saison a eu lieu les 10 et 11 juin, avec le soleil et une mer d\'huile bien agréable. Et ce sont 4 N2, 1 Pe40,  1 N3, 3 Nitrox et 4 Nitrox confirmés qui ont pu être délivrés. BRAVO !!! Belle récolte.<br>', 29, '', 'droite', '20170313-230336-tmpfile.jpg'),
(55, '2017-02-23 00:00:00', '<p style=\"background-color:#808B96;\"><font color=\"black\">Décès de Jean-Louis Pignard le 23 mars 2017</font></p>', '<p style=\"background-color:#808B96;\"><font color=\"black\">\r\n<br>\r\nJean-Louis était au GUC PLONGEE depuis 1971 et avait 71 ans. Il a été président du GUC PLONGEE en 1980, moniteur depuis 1976 et a longtemps été responsable des baptêmes avant de passer la main. Mais il nous était resté fidèle, en venant chaque mardi prêter main forte à Jean-Francois et Yves pour le gonflage des blocs.<br><br>\r\n\r\nC’était un gaillard solide, ex rugbyman, la personnification même de la force tranquille.<br>\r\n\r\nToutes nos pensées vont à Josiane et ses proches.<br><br>\r\n</font></p>', 27, '', 'gauche', NULL),
(56, '2017-04-03 00:00:00', 'Stage Trimix', 'Le club a organisé son premier stage trimix élémentaire au début du mois de mai. Malgré une mer agitée, le stage a été un franc succès grâce notamment à l\'accueil chaleureux et professionnel de la structure d\'accueil Azur Pongée. Le trimix élémentaire \"normoxyque\" permet de plonger en toute sécurité jusqu\'à une profondeur de 70m avec des risques de narcose et d’essoufflement atténués. Cela rend possible l’exploration de nouveaux sites profonds, ou plus simplement d’en redécouvrir d’autres dans de bien meilleures conditions. L’expérience sera probablement renouvelée.', 28, '', 'gauche', '20170604-190631-tmpfile.jpg'),
(57, '2017-04-28 00:00:00', 'Week-End Validation N1 les 20 et 21 mai 2017 à Niolon', 'Le week-end des 20 et 21 mai dernier à vu la validation de 12 nouveaux N1 au club. <br><br> \r\nLe samedi la mer était un peu agitée mais le dimanche fut une journée splendide, avec le soleil et une mer super calme, pour le plaisir de tous.<br><br> \r\nVoici la photo souvenir de tous ces nouveaux N1 avec leurs formateurs présents à Niolon.<br><br>', 30, '', 'dessous', '20170608-220645-tmpfile.jpg'),
(58, '2017-05-08 00:00:00', 'Stage et Examen N4 du 8 au 11 juin à Niolon', 'Pour la troisième année consécutive le GUC PLONGEE a organisé un examen N4 à Niolon. Cette année l\'examen a été précédé de 2 jours de stage final afin de permettre aux 3 candidats d’affûter leurs réglages.<br><br>\r\nEt c\'est avec un merveilleux soleil que Christophe et Olivier ont obtenu leurs N4. Félicitations !!!<br><br>\r\nCi-dessous la photo des candidats avec leur jury  lors de la remise des diplômes, avec de gauche à droite : Christophe, Olivier, Thomas (MF2), Tony, Yves (MF2) et Christelle (MF2, présidente du jury). <br><br>\r\nBRAVO à tous les candidats et merci aux membres du jury et moniteurs ayant participé au stage final et à l\'examen, MAIS AUSSI BRAVO POUR L\'ORGANISATION : Sigo et Thomas.', 31, '', 'dessous', '20170611-230608-tmpfile.jpg'),
(59, '2017-05-18 00:00:00', 'Plongée du dimanche matin a Laffrey', 'Les plongées du dimanche matin ont lieu depuis peu à la nouvelle base de plongée de Laffrey aménagée par les collectivités locales. Parking, ponton flottant, un grand muret pour s\'équiper de manière confortable, un coffre de rangement (amener la cadenas) et un restau sympa tout a coté. A la clé, écrevisses, perches mais pas que.', 32, '', 'gauche', '20170618-220628-tmpfile.jpg'),
(60, '2017-05-29 00:00:00', 'Week-End de plongée pour la section enfants', '<p>Ce W.E la section enfants du GUC plongée était a Saint-Cyr sur mer pour sa sortie annuelle, et comme chaque année, soleil, ambiance et convivialité étaient au rendez-vous.</p>\r\n<p>Leurs encadrants (Sur la photo Guy, Pierre , re-Pierre, Thomas, Jérome et Bruno) les ont accompagnés et leur ont fait découvrir la faune et la flore de la Méditerranée tout au long de ce W.E.</p>', 33, '', 'droite', '20170629-070650-tmpfile.jpg'),
(61, '2017-05-29 00:00:00', 'Deux nouveaux initiateurs', 'Félicitations à nos deux nouveaux initiateurs Fred et Olivier qui viennent rejoindre l\'équipe d\'encadrement du club. Avec l\'augmentation de l\'activité formation en 2016-2017, gageons qu\'ils seront les bienvenus pour prêter main forte et exercer leur nouveau savoir-faire. Un grand merci à René et Serge pour les avoir coaché tout le long de l\'année.', 34, '', 'gauche', '20170629-130658-tmpfile.jpg'),
(62, '2017-07-23 00:00:00', 'Plongée du Dimanche à Aix-Les-Bains', 'Plongée sur le tombant de Chatillon, à Chindrieux. Ce tombant à l\'avantage de permettre les évolutions dans tous les espaces jusque 60m\r\nLes conditions météo étaient au top ce jour-là. \r\nLes autres photos sont visibles sur la <a href=\"https://guc-plongee.net/galerie/index.php?rep=.%2Fimages%2Fimg%2F0110%40Aout%202017%20-%20Tombant%20de%20Chatillon%20-%20Aix%20les%20Bains\">galerie</a>', 35, '', 'dessous', '20170823-180818-tmpfile.jpg'),
(63, '2017-07-31 00:00:00', 'Inscriptions Rentrée 2017 - 2018', '<p><h4>Les inscriptions sont ouvertes depuis le 8 septembre !!!</h4></p>\r\n<p>La pré-inscription via le formulaire du site Web est obligatoire. Après avoir renseigné le formulaire et validé votre pré-inscription, vous devrez imprimer votre dossier (1 page) qui sera disponible sur la page de confirmation de pré-inscription et dans un mail envoyé à l\'adresse indiqué dans le formulaire.</p> \r\n<p>Votre inscription sera effective après la remise de votre dossier complet à la piscine du campus :<br>\r\n- Mardi 12 septembre uniquement pour les inscriptions de 19H à 21H. Pas d’accès au bassin. Pas de baptême.<br>\r\n- Mardi 19 septembre pour les inscriptions de 19H à 21H. Accès possible au bassin uniquement pour les anciens adhérents à jours de leurs certificats médicaux ainsi que pour les baptêmes à partir de 20H.<br>\r\n- Mardi 26 septembre et mardi 3 octobre : inscriptions de 19h à  21h.  Seance piscine à 19h45. Début des cours.<br>\r\n- <b>A partir du mardi 10 octobre et tous les autres mardis : inscriptions de 19H30 à 20H et séance piscine à 19H45.</b><br></p>\r\n\r\n<p>Seuls les dossiers complets avec un certificat médical d\'un <b>médecin du sport, médecin fédéral ou médecin hyperbare</b> seront acceptés. La plongée est l\'un des sports pour lesquels un certificat médical <b>de moins d\'un an</b> reste obligatoire.</p>\r\n<p class=\"redw\">La section apnée est complète, Les inscriptions apnée sont closes. Pour tous renseignements contacter Philippe PEAN phil@apnealp.fr</p>', 40, '', 'gauche', NULL),
(64, '2017-09-09 00:00:00', 'Forum des Sports de Grenoble le 9 septembre 2017', 'L\'Equipe du GUC Plongée avait le sourire au forum des sports de Grenoble  à Grand\'Place.\r\n\r\nMerci à l\'ensemble des volontaires pour l\'animation du stand. Nous avons enregistré 87 contacts !!! <br>\r\nEt merci aux 3 organisateurs : Delphine, Nadège et Christophe !!!', 36, '', 'dessous', '20170909-080922-tmpfile.jpg'),
(66, '2017-09-17 00:00:00', 'Soirée conviviale à Cap Croisette', '', 37, '', 'dessous', '20170916-190912-tmpfile.jpg'),
(67, '2017-09-01 00:00:00', 'Week-end recyclage encadrants a l\'UCPA de Niolon', 'Douze moniteurs du club ont participé à une séance de recyclage organisée par le centre UCPA de Niolon. Ces séances ne sont pas rendues obligatoires par notre fédération de tutelle, mais notre directeur technique Thomas a poussé l\'idée en avant, arguant d\'une meilleure cohérence de l\'enseignement au bénéfice de nos élèves. Le beau temps et la bonne humeur étaient au rendez-vous. Le week-end a été un franc succès et il sera renouvelé, pour satisfaire celles et ceux qui sont sur la liste d\'attente. Merci à Stéphanie, Christophe, Davis et Marco pour leur patience, et précieux conseils.', 39, '', 'dessous', '20171001-201031-tmpfile.jpg'),
(68, '2017-10-06 00:00:00', 'Novembre 2017 - Le GUC aux MALDIVES', 'Le sortie Maldives organisée par Didier a remporté un grand succès avec la participation de 20 Gucistes !!!<br>\r\nLes guides de Dune, Lulu, Yoyo et Fathu ont été formidables par leurs sourires, leur enthousiasme, leur investissement et l\'organisation parfaite des plongées. Le tout sur un bateau très vaste et confortable : le Soleil 2. La faune aussi a répondu présente avec les raies mantas, aigles, pastenagues, les requins baleines, gris, nourrices, corail, pointe noires, les barracudas, les napoléons, les tortues, les .... <br>\r\nBref, c\'est quand qu\'on repart ????', 41, '', 'dessous', '20171217-181221-tmpfile.jpg'),
(70, '2017-11-20 00:00:00', 'Soirée de Noël', 'Le Père Noël avait fière allure. Aidé de la main innocente de notre benjamine Zoé, il a distribué ses cadeaux à  la foule nombreuse de plongeurs. Merci à Stephanie et Delphine pour l\'organisation sans faille de la fête.', 42, '', 'gauche', '20171220-161256-tmpfile.jpg'),
(71, '2018-03-11 00:00:00', 'Saison 2018 - WE techniques à NIOLON', 'Les week-end techniques ont repris à Niolon dès le week-end des 17 et 18 mars. Le soleil était présent et l\'eau un peu fraîche bien sûr. Mais comme le quai de l\'UCPA était interdit, c\'est l\'embarquement depuis le port de Niolon qui a été innovant. Avec en prime un transport des blocs dans la camionnette de l\'UCPA au milieu des larges rues de la calanque.  Bravo à Christophe pour ses manœuvres au centimètre prêt.<br><br>\r\nLe week-end suivant des 7 et 8 avril tout est revenu dans l\'ordre pour le quai mais c\'est la météo qui n\'a pas été clémente avec les plongeurs. Un vent d\'Est rentrant dans la calanque. Il a fallu plonger depuis le quai fraîchement remis en service.<br><br>\r\nAvec le week-end des 21 et 22 avril tout était parfait, sauf la température de l\'eau bien sûr, encore un peu fraîche. Mais cela a permis de pouvoir valider une nouvelle N3 (Manon), un nouveau N2 (Alexandre) et 3 N1 (Hélène, Eric et Loic) !!! <br><br>\r\nEt puis ce fut le grand week-end des 5, 6, 7 et 8 mai. 4 jours avec un soleil voilé et quelques ondées, mais pas de vent et une mer très calme, ce qui a permis de faire une plongée sur le Planier (Merci l\'UCPA), toujours très appréciée. Et puis avec 4 jours, ce sont 2 nouveaux N3, 4 N2 et 3 Pe40 qui ont été validés. Belle moisson !<br><br>', 43, '', 'dessous', '20180411-000406-tmpfile.jpg'),
(72, '2018-03-14 00:00:00', 'Le GUC en voyage au Mexique', 'Au programme un tour-circuit d\'une durée de 5 jours, suivi par des plongées au cenotes, playa et Cozumel', 44, '', 'dessous', '20180414-200458-tmpfile.jpg'),
(73, '2018-04-29 00:00:00', 'Niolon - Validation des Niveaux 1 millésime 2018', 'La météo a été clémente pour la validation des N1. \r\nLe soleil était bien présent et la mer très calme les matins ce qui nous a permis d\'aller visiter le Chaouen au Planier dimanche matin.\r\nCe sont donc 17 nouveaux N1 qui vont pouvoir partir explorer les mers et océans.', 45, '', 'dessous', '20180529-150550-tmpfile.jpg'),
(74, '2018-05-20 00:00:00', 'BBQ : le beau temps était au rendez-vous ....', '... ainsi que les GUCistes venus nombreux pour papoter et partager les derniers souvenirs de plongée, les plans vacances de l\'été,, ou discuter de la couleur du temps. Organisation au cordeau par Delphine et Stephanie, cuisson au poil par les aides cuisiniers GG et JJ, Merci a tous pour avoir rendu cet évènement possible, et mention spéciale au machiniste Philippe McGiver pour la lumière et les tables. A refaire.', 46, '', 'gauche', '20180620-170640-tmpfile.jpg'),
(75, '2018-07-12 00:00:00', 'Reprise des activités Rentrée 2018 - 2019', '<h4>Les inscriptions sont ouvertes depuis le 14 septembre !!!</h4>\r\n\r\n<p><br />\r\nPlanning de rentr&eacute;e :<br />\r\n<br />\r\n- Mardi 18 septembre : inscriptions de 19H &agrave; 22H. Acc&egrave;s bassin &agrave; partir de 20h uniquement pour les bapt&ecirc;mes et les anciens adh&eacute;rents avec un certificat m&eacute;dical valide<br />\r\n- Mardi 25 septembre : inscriptions de 19H &agrave; 22H. Acc&egrave;s possible au bassin &agrave; partir de 20h pour tous les adh&eacute;rents avec un certificat m&eacute;dical valide et les bapt&ecirc;mes.<br />\r\n- Mardi 2 octobre : inscriptions de 19H &agrave; 22H. Acc&egrave;s possible au bassin &agrave; partir de 20h pour tous les adh&eacute;rents avec un certificat m&eacute;dical valide et les bapt&ecirc;mes. D&eacute;but des cours.<br />\r\n- A partir du mardi 9 octobre et tous les autres mardis : inscriptions de 19H00 &agrave; 20H et s&eacute;ance piscine &agrave; partir de 19H45<br />\r\n.<br />\r\nPour plus de renseignements, vous pouvez nous &eacute;crire via la page <strong>CONTACT</strong><br />\r\n&nbsp;</p>', 47, 'http://www.omsgrenoble.com/', 'droite', NULL);
